Description:
            This simple white canvas kids teepee - tipi is made of 100% cotton. Holders with stainless steel buttons. To the right or to the left of the entrance may be a window (as you wish). Teepee is formed as an umbrella for a few seconds.
It can be used indoors or outdoors, but do not leave it in the rain.
!!!Teepee sold without pompons!!!
ALL OUR TEEPEES WITH POLES AND BAG FOR STORING TEEPEE.
